import React, { Component } from 'react'
import PageNavbar from "./PageNavbar";
import {MapContainer, GeoJSON, Popup, Marker} from 'react-leaflet'
import GeojsonData from './../countries.json'
export default class COVID19_world_map extends Component {

    constructor(){
        super()
        this.state = {
            word : '12312312'
        }
    }

    render() {
        return ( 
            <div>             
                <MapContainer style={{height:"80vh"}} zoom={3} center={[20, 100]} scrollWheelZoom={false}>
                    <GeoJSON 
                    data={GeojsonData.features}
                        style={() => ({
                        color: '#4a83ec',
                        weight: 0.5,
                        fillColor: "#1a1d62",
                        fillOpacity: 1,
                    })}
                    />
                    <Marker position={[20, 100]}>
                        <Popup>
                            abc
                        </Popup>
                    </Marker>
                </MapContainer>
            </div>
        )
    }
}
